import React from "react"

export default function Skill({name, icon }) {
  return (
    <div>
    <h3 className="fs-5">
    {name}<i className={`fa-brands ${icon}`}></i>
  </h3>
  <div className="ps-2">
    <div className="skills-container">
      <div className="skills w-50" style={{ 'backgroundColor': 'red'}}></div>
    </div>
  </div>
  </div>
  );
}
